function beforeTaskSave(colleagueId,nextSequenceId,userList){
	log.info('#### >> ADITIVO - BEFORETASKSAVE')
	var ativAtual = getValue("WKNumState");
	var solicitacao = getValue("WKNumProces")
	validarAnexosPorAtividade(ativAtual);
}

function validarAnexosPorAtividade(ativAtual){
	// Documento consultar fonecedor
	if (ativAtual==2){
		nmArquivo = hAPI.getCardValue("txt_nomeArquivo_01");
		obterIdDocumento(ativAtual,"txt_idDoc01",nmArquivo)
	}

	// Documento nota técnica Solicitante
	if (ativAtual==2){
		nmArquivo = hAPI.getCardValue("txt_nomeArquivo_27");
		obterIdDocumento(ativAtual,"txt_idDoc27",nmArquivo)
		validarAnexo(nmArquivo, false);
	}

	// DOCUMENTO NOTA TECNICA - COMPRAS
	if (ativAtual==7){
		nmArquivo = hAPI.getCardValue("txt_nomeArquivo_07");
		obterIdDocumento(ativAtual,"txt_idDoc07",nmArquivo)
		validarAnexo(nmArquivo, false);
	}

	// DOCUMENTO PARECER JURIDICO
	if (ativAtual==15){
		nmArquivo = hAPI.getCardValue("txt_nomeArquivoParecer_10");
		obterIdDocumento(ativAtual,"txt_idDoc10Parecer",nmArquivo)
		validarAnexo(nmArquivo, false);
	}

	// DOCUMENTO MINUTA
	if (ativAtual==15){
		nmArquivo = hAPI.getCardValue("txt_nomeArquivoMinuta_10");
		obterIdDocumento(ativAtual,"txt_idDoc10Minuta",nmArquivo)
		validarAnexo(nmArquivo, false);
	}
}

function validarAnexo(target, apenasPdf){
	var found = false;
	
	var docs = hAPI.listAttachments();
	if (docs.size() > 0) {
		var found = true;
	}
	if(!found) throw target + " é obrigatório!";
}

function obterIdDocumento(ativAtual,fieldDestino,nmArquivo){
	var docs = hAPI.listAttachments();
	for (var i = 0; i < docs.size(); i++) {
		var doc = docs.get(i);
		var dsAnexo = doc.getDocumentDescription();
		if (dsAnexo==nmArquivo){
			var idAnexo = doc.getDocumentId();
	        hAPI.setCardValue(fieldDestino,idAnexo);
		}
	}
}

function servicetask208(attempt, message) {
  log.info('TGS - MAANANGERAPPROVES');
  var errorMsg = [];
  var idUser = getValue('WKUser');
  var idProcess = getValue('WKNumProces');
  // var manangerApproves = true;
  var contrato = hAPI.getCardValue('txt_nProcesso_17');

  var cs = [
    DatasetFactory.createConstraint('contrato', contrato, contrato, ConstraintType.MUST),
  ];

  var dataset = DatasetFactory.getDataset('ds_tornar_aditivo_vigente', null, cs, null);

  if (
    dataset != undefined &&
    dataset != null &&
    dataset.rowsCount != null &&
    dataset.rowsCount != undefined &&
    dataset.rowsCount > 0
  ) {
    var retorno = dataset.getValue(0, "status");
    log.info('RETORNO MANAGER APPROVES');
    log.dir(retorno)
    if (hasValue(retorno)) {
      if (retorno == 201) {
        var msgValidacao = dataset.getValue(0, 'status') + ' - ' + dataset.getValue(0, 'msg');
        addSetTaskComments(idUser, idProcess, msgValidacao);
      } else if (retorno != 201) {
        var msgValidacao = dataset.getValue(0, 'status') + ' - ' + dataset.getValue(0, 'msg');
        var errorMsgManagerApproves = 'Integração Gestor Aprova: ' + msgValidacao;
        errorMsg.push(errorMsgManagerApproves)
      }
    } else {
      throw 'O retorno da integração GESTOR APROVA não obteve êxito. Por favor, entre em contato com a TI.';
    }
  }
}

